    console.log(movies)
    return (
        <div className="movieBody">
            <div className="movieCard">
                <div className="cardPic">Pictures</div>
                <div className="cardInText">
                    <h2>Intersteller</h2>
                    <p>Lorem ipsum dolor sit amed, kulfuallahu ahet amin yarrr</p>
